import React, { useState, useEffect } from 'react';

export default function Wall(props) {
    const message = props.message



    console.log(message)

    return (
        <div>
            <table>
                <thead>
                    <tr>WALL</tr>
                </thead>
                <tbody>
                    <tr></tr>
                {message ?
                    message.map(e => {
                        return (
                            <td key={e.id}>
                                {e.message}
                            </td>
                        )
                    })
                    : null}
                </tbody>
            </table>
        </div>
    )
}
